import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <header style={{ padding: "10px", background: "#4CAF50", color: "white" }}>
      <h1>Alberto Portfolio</h1>
      <nav>
        <NavLink
          to="/"
          style={({ isActive }) => ({
            margin: "0 15px",
            color: isActive ? "yellow" : "white",
            textDecoration: "none",
          })}
        >
          Home
        </NavLink>
        <NavLink
          to="/blog"
          style={({ isActive }) => ({
            margin: "0 15px",
            color: isActive ? "yellow" : "white",
            textDecoration: "none",
          })}
        >
          Blog
        </NavLink>
        <NavLink
          to="/projects"
          style={({ isActive }) => ({
            margin: "0 15px",
            color: isActive ? "yellow" : "white",
            textDecoration: "none",
          })}
        >
          Projects
        </NavLink>
        <NavLink
          to="/about"
          style={({ isActive }) => ({
            margin: "0 15px",
            color: isActive ? "yellow" : "white",
            textDecoration: "none",
          })}
        >
          About
        </NavLink>
        <NavLink
          to="/login"
          style={({ isActive }) => ({
            margin: "0 15px",
            color: isActive ? "yellow" : "white",
            textDecoration: "none",
          })}
        >
          Login
        </NavLink>
        <NavLink
          to="/register"
          style={({ isActive }) => ({
            margin: "0 15px",
            color: isActive ? "yellow" : "white",
            textDecoration: "none",
          })}
        >
          Register
        </NavLink>
      </nav>
    </header>
  );
};

export default Header;
